import React from 'react';
import '../rightBar/rightBar.css';
import {
    NavLink
} from 'react-router-dom';
import {
    useHttp
} from '../../hooks/http.hook';

const NewsContent = ({
    images
}) => {
    <
    div className = 'newsContent' >
        <
        img src = {
            props.images
        } > < /img> <
        span > {
            props.text
        } < /span> <
        NavLink > < /NavLink> <
        /div>
}

export default NewsContent;
